import ServerList from './components/ServerList';
import AddDevice from "./components/AddDevice";

import './App.css';
import Container from "react-bootstrap/Container";
import Col from "react-bootstrap/Col";

function App() {
  return (
    <div className="App">

        <ServerList/>;
        <Container>

                <Col>
                  <AddDevice/>;
                </Col>


        </Container>


    </div>
  );
}

export default App;
